insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (1, 0, '2019-07-18 03:44:12', 'http://dummyimage.com/144x230.jpg/ff4444/ffffff', '2019-07-13 23:27:48', 'Wing D', 'Room 4', 10, 15, 2, 6, 3, 'A tree needs to be your friend if you''re going to paint him. Even the worst thing we can do here is good.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (2, 0, '2019-07-22 07:38:29', null, '2019-07-06 20:56:47', 'Wing A', 'Room 5', 5, 1, 4, 6, 1, 'The little tiny Tim easels will let you down.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (3, 0, '2019-07-22 20:04:04', 'http://dummyimage.com/111x166.jpg/5fa2dd/ffffff', '2019-07-03 15:22:58', 'Wing B', 'Room 3', 13, 13, 4, 4, 2, 'Don''t be bashful drop me a line. Now let''s put some happy little clouds in here.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (4, 0, null, 'http://dummyimage.com/135x170.jpg/5fa2dd/ffffff', '2019-06-25 19:53:17', 'Wing B', 'Room 2', 14, 18, 2, 2, 3, 'Isn''t that fantastic that you can create an almighty tree that fast? You can get away with a lot. I''ll go over the colors one more time that we use: Titanium white, Thalo green, Prussian blue, Van Dyke brown, Alizarin crimson, Sap green, Cad yellow, and Permanent red.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (5, 0, '2019-07-13 19:48:22', 'http://dummyimage.com/191x145.jpg/5fa2dd/ffffff', '2019-07-13 20:10:31', 'Wing A', 'Room 5', 3, 9, 4, 2, 1, 'That easy. Exercising the imagination, experimenting with talents, being creative; these things, to me, are truly the windows to your soul. Isn''t that fantastic? You can just push a little tree out of your brush like that.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (6, 0, '2019-07-12 00:44:27', 'http://dummyimage.com/163x247.jpg/5fa2dd/ffffff', '2019-07-05 16:00:15', 'Wing D', 'Room 2', 13, 7, 3, 5, 3, 'A fan brush is a fantastic piece of equipment. Use it. Make friends with it.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (7, 0, '2019-07-02 08:55:17', null, '2019-07-19 17:20:47', 'Wing A', 'Room 3', 11, 19, 1, 1, 3, 'I really believe that if you practice enough you could paint the ''Mona Lisa'' with a two-inch brush. This is an example of what you can do with just a few things, a little imagination and a happy dream in your heart. You can''t make a mistake. Anything that happens you can learn to use - and make something beautiful out of it.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (8, 0, '2019-07-07 14:44:56', null, '2019-07-09 19:29:02', 'Wing C', 'Room 3', 14, 3, 3, 2, 2, 'This is truly an almighty mountain.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (9, 0, null, null, '2019-07-05 02:08:35', 'Wing B', 'Room 3', 3, 17, 4, 1, 1, 'If you didn''t have baby clouds, you wouldn''t have big clouds. Get tough with it, get strong.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (10, 0, null, null, '2019-07-07 17:18:19', 'Wing D', 'Room 4', 6, 4, 3, 6, 3, 'Paint anything you want on the canvas. Create your own world. I really recommend you use odorless thinner or your spouse is gonna run you right out into the yard and you''ll be working by yourself. Sometimes you learn more from your mistakes than you do from your masterpieces.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (11, 0, '2019-06-29 17:07:25', null, '2019-07-16 18:58:20', 'Wing A', 'Room 2', 5, 5, 3, 6, 2, 'Let your imagination just wonder around when you''re doing these things.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (12, 0, '2019-07-05 15:07:34', null, '2019-06-25 13:26:07', 'Wing B', 'Room 3', 16, 20, 1, 2, 3, 'We touch the canvas, the canvas takes what it wants. Everyone is going to see things differently - and that''s the way it should be. It''s almost like something out of a fairytale book.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (13, 0, '2019-07-01 18:25:24', null, '2019-07-08 03:48:40', 'Wing A', 'Room 6', 16, 9, 4, 3, 1, 'I''m a water fanatic. I love water.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (14, 0, '2019-07-12 05:36:07', null, '2019-07-02 08:03:25', 'Wing D', 'Room 6', 20, 11, 2, 3, 2, 'Van Dyke Brown is a very nice brown, it''s almost like a chocolate brown. Let all these little things happen. Don''t fight them. Learn to use them. Nature is so fantastic, enjoy it. Let it make you happy.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (15, 0, '2019-06-25 11:21:13', 'http://dummyimage.com/144x207.jpg/dddddd/000000', '2019-07-07 13:13:50', 'Wing A', 'Room 4', 5, 17, 4, 3, 1, 'I was blessed with a very steady hand; and it comes in very handy when you''re doing these little delicate things.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (16, 0, '2019-07-04 04:50:38', null, '2019-07-03 10:04:31', 'Wing D', 'Room 5', 8, 7, 2, 4, 2, 'See there how easy that is. You have to make those little noises or it won''t work. Let your imagination be your guide.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (17, 0, null, 'http://dummyimage.com/148x172.jpg/dddddd/000000', '2019-07-03 20:43:12', 'Wing B', 'Room 2', 5, 3, 1, 5, 3, 'Clouds are free they come and go as they please.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (18, 0, '2019-07-12 09:17:42', null, '2019-07-11 05:50:08', 'Wing C', 'Room 6', 11, 2, 1, 3, 3, 'Now, we''re going to fluff this cloud. If we''re gonna walk though the woods, we need a little path.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (19, 0, '2019-06-24 16:34:59', 'http://dummyimage.com/244x122.jpg/dddddd/000000', '2019-07-11 14:57:29', 'Wing A', 'Room 6', 17, 2, 4, 5, 1, 'And I will hypnotize that just a little bit. You can spend all day playing with mountains.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (20, 0, '2019-07-04 21:51:32', 'http://dummyimage.com/135x101.jpg/dddddd/000000', '2019-07-01 03:42:59', 'Wing D', 'Room 1', 18, 10, 2, 6, 3, 'That''s a crooked tree. We''ll send him to Washington.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (21, 0, '2019-07-03 20:30:54', null, '2019-07-15 19:05:34', 'Wing D', 'Room 1', 9, 1, 2, 1, 3, 'This is the way you take out your flustrations. We have all at one time or another mixed some mud. Do an almighty painting with us.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (22, 0, '2019-07-10 03:14:44', null, '2019-06-26 19:22:04', 'Wing B', 'Room 2', 15, 19, 1, 2, 2, 'But we''re not there yet, so we don''t need to worry about it. Nothing''s gonna make your husband or wife madder than coming home and having a snow-covered dinner.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (23, 0, '2019-07-20 09:01:07', null, '2019-06-30 17:24:51', 'Wing D', 'Room 2', 1, 4, 3, 1, 2, 'Get away from those little Christmas tree things we used to make in school. There are no mistakes. You can fix anything that happens.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (24, 0, '2019-07-12 01:43:06', null, '2019-07-14 11:21:08', 'Wing C', 'Room 6', 6, 13, 4, 5, 2, 'Isn''t that fantastic that you can make whole mountains in minutes? If these lines aren''t straight, your water''s going to run right out of your painting and get your floor wet. Let''s make some happy little clouds in our world.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (25, 0, '2019-07-13 11:39:54', null, '2019-07-10 18:31:09', 'Wing B', 'Room 4', 13, 4, 3, 5, 1, 'Don''t fight it, use what happens.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (26, 0, '2019-07-10 03:32:57', 'http://dummyimage.com/138x192.jpg/cc0000/ffffff', '2019-06-30 13:53:05', 'Wing A', 'Room 4', 14, 11, 3, 2, 2, 'Now we''ll take the almighty fan brush.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (27, 0, '2019-07-04 16:08:48', null, '2019-07-22 23:57:26', 'Wing D', 'Room 6', 6, 6, 3, 5, 3, 'It''s cold, but it''s beautiful. Each highlight must have it''s own private shadow.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (28, 0, null, null, '2019-07-03 11:07:29', 'Wing B', 'Room 4', 12, 5, 3, 2, 3, 'Don''t fiddle with it all day. All those little son of a guns. Zip. That easy.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (29, 0, '2019-07-01 19:58:08', null, '2019-07-03 12:57:06', 'Wing A', 'Room 6', 18, 13, 3, 3, 3, 'It''s all a game of angles. Nothing wrong with washing your brush. We''ll do another happy little painting.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (30, 0, '2019-07-13 20:33:29', 'http://dummyimage.com/110x187.jpg/5fa2dd/ffffff', '2019-07-12 10:46:48', 'Wing B', 'Room 1', 2, 1, 3, 3, 3, 'Let''s build an almighty mountain. Here''s something that''s fun.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (31, 0, '2019-07-16 02:11:06', null, '2019-06-26 14:12:55', 'Wing D', 'Room 6', 7, 16, 2, 3, 3, 'I started painting as a hobby when I was little. I didn''t know I had any talent. I believe talent is just a pursued interest. Anybody can do what I do. If you hypnotize it, it will go away. Working it up and down, back and forth.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (32, 0, '2019-07-22 03:18:52', 'http://dummyimage.com/192x138.jpg/ff4444/ffffff', '2019-07-07 21:52:44', 'Wing B', 'Room 2', 12, 6, 4, 2, 2, 'The light is your friend. Preserve it.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (33, 0, '2019-07-01 19:52:18', null, '2019-07-17 08:31:27', 'Wing B', 'Room 5', 18, 10, 3, 5, 2, 'You can work and carry-on and put lots of little happy things in here.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (34, 0, null, null, '2019-07-11 04:05:31', 'Wing B', 'Room 3', 2, 6, 3, 4, 2, 'So often we avoid running water, and running water is a lot of fun. The very fact that you''re aware of suffering is enough reason to be overjoyed that you''re alive and can experience it.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (35, 0, '2019-07-01 09:49:06', null, '2019-07-10 09:54:49', 'Wing A', 'Room 1', 4, 11, 3, 1, 2, 'Let''s put some highlights on these little trees. The sun wouldn''t forget them. Be careful. You can always add more - but you can''t take it away.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (36, 0, '2019-07-11 11:04:34', null, '2019-07-13 17:43:51', 'Wing B', 'Room 4', 13, 20, 1, 6, 1, 'A beautiful little sunset. You can do anything your heart can imagine. It is a lot of fun.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (37, 0, '2019-07-22 08:04:10', 'http://dummyimage.com/206x172.jpg/cc0000/ffffff', '2019-07-12 23:39:00', 'Wing B', 'Room 2', 15, 16, 4, 5, 1, 'It''s so important to do something every day that will make you happy. Painting should do one thing. It should put happiness in your heart. Poor old tree.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (38, 0, '2019-07-02 08:41:22', null, '2019-07-22 17:12:44', 'Wing D', 'Room 6', 6, 13, 2, 4, 1, 'Let your heart be your guide. Now it''s beginning to make a little sense. If what you''re doing doesn''t make you happy - you''re doing the wrong thing.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (39, 0, '2019-07-22 01:47:21', null, '2019-07-16 11:58:22', 'Wing A', 'Room 6', 19, 15, 3, 5, 2, 'Just make little strokes like that.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (40, 0, '2019-07-17 14:16:31', null, '2019-07-04 14:06:36', 'Wing C', 'Room 3', 3, 12, 3, 3, 1, 'Trees grow however makes them happy. Trees cover up a multitude of sins. But they''re very easily killed. Clouds are delicate.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (41, 0, null, null, '2019-07-21 14:26:09', 'Wing D', 'Room 2', 19, 19, 2, 5, 2, 'Jane had sent Caroline an early answer to her letter, and was counting the days till she might reasonably hope to hear again. The promised letter of thanks from Mr. Collins arrived on Tuesday');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (42, 0, '2019-07-05 12:49:50', 'http://dummyimage.com/191x249.jpg/5fa2dd/ffffff', '2019-07-04 12:22:31', 'Wing D', 'Room 3', 16, 17, 1, 4, 1, 'Tuesday, addressed to their father, and written with all the solemnity of gratitude which a twelvemonth’s abode in the family might have prompted. After discharging his conscience on that head, he proceeded to inform them, with many rapturous expressions, of his happiness in having obtained the affection of their amiable neighbour');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (43, 0, '2019-07-02 21:41:27', null, '2019-06-29 17:19:20', 'Wing D', 'Room 6', 2, 16, 1, 1, 2, 'Mr. Collins’s return into Hertfordshire was no longer a matter of pleasure to Mrs. Bennet. On the contrary, she was as much disposed to complain of it as her husband. It was very strange that he should come to Longbourn instead of to Lucas Lodge;');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (44, 0, '2019-07-02 20:15:30', 'http://dummyimage.com/161x108.jpg/5fa2dd/ffffff', '2019-07-15 13:35:47', 'Wing C', 'Room 6', 19, 10, 4, 3, 2, ' It was also very inconvenient and exceedingly troublesome. She hated having visitors in the house while her health was so indifferent, and lovers were of all people the most disagreeable.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (45, 0, '2019-07-02 21:00:33', null, '2019-07-02 05:13:58', 'Wing D', 'Room 6', 20, 5, 1, 2, 1, 'Two inferences, however, were plainly deduced from the whole: one, that Elizabeth was the real cause of the mischief; and the other that she herself had been barbarously misused by them all; and on these two points she principally dwelt during the rest of the day. Nothing could console and nothing could appease her.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (46, 0, '2019-07-02 14:56:48', null, '2019-07-18 22:26:30', 'Wing D', 'Room 1', 20, 17, 3, 4, 2, 'Miss Lucas, and then explained that it was merely with the view of enjoying her society that he had been so ready to close with their kind wish of seeing him again at Longbourn, whither he hoped to be able to return on Monday fortnight; for Lady Catherine, he added, so heartily approved his marriage, that she wished it to take place as soon as possible, which he trusted would be an unanswerable argument with');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (47, 0, '2019-07-15 03:07:42', null, '2019-06-27 16:32:50', 'Wing C', 'Room 2', 11, 4, 2, 1, 2, 'Jane confessed herself a little surprised at the match; but she said less of her astonishment than of her earnest desire for their happiness; nor could Elizabeth persuade her to consider it as improbable. Kitty and Lydia were far from envying Miss Lucas, for Mr. Collins was only a clergyman; and it affected them in no other way than as a piece of news to spread at Meryton.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (48, 0, '2019-07-20 17:34:17', 'http://dummyimage.com/109x166.jpg/cc0000/ffffff', '2019-06-26 23:19:29', 'Wing C', 'Room 2', 5, 20, 2, 1, 3, 'Whenever she spoke in a low voice to Mr. Collins, was convinced that they were talking of the Longbourn estate, and resolving to turn herself and her daughters out of the house, as soon as Mr. Bennet were dead. She complained bitterly of all this to her husband.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (49, 0, '2019-07-03 01:31:42', null, '2019-06-30 14:32:54', 'Wing A', 'Room 2', 4, 14, 4, 4, 3, 'Nor did that day wear out her resentment. A week elapsed before she could see Elizabeth without scolding her, a month passed away before she could speak to Sir William or Lady Lucas without being rude, and many months were gone before she could at all forgive their daughter.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (50, 0, '2019-07-13 19:54:55', null, '2019-07-21 04:13:10', 'Wing D', 'Room 5', 19, 9, 3, 4, 1, 'This was not very consoling to Mrs. Bennet, and therefore, instead of making any answer, she went on as before.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (51, 0, '2019-07-21 07:56:15', null, '2019-07-16 22:12:40', 'Wing D', 'Room 3', 1, 7, 1, 2, 3, 'Mrs. Gardiner and Elizabeth talked of all that had occurred during their visit, as they returned, except what had particularly interested them both. The look and behaviour of everybody they had seen were discussed, except of the person who had mostly engaged their attention. ');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (52, 0, '2019-06-30 12:42:56', null, '2019-07-04 21:20:10', 'Wing C', 'Room 6', 14, 3, 1, 5, 1, 'They talked of his sister, his friends, his house, his fruit--of everything but himself; yet Elizabeth was longing to know what Mrs. Gardiner thought of him, and Mrs. Gardiner would have been highly gratified by her niece’s beginning the subject.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (53, 0, '2019-07-09 09:06:13', null, '2019-07-12 19:43:33', 'Wing A', 'Room 1', 7, 16, 4, 6, 3, 'Lady Lucas could not be insensible of triumph on being able to retort on Mrs. Bennet the comfort of having a daughter well married; and she called at Longbourn rather oftener than usual to say how happy she was, though Mrs. Bennet’s sour looks and ill-natured remarks might have been enough to drive happiness away.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (54, 0, '2019-07-17 01:13:34', null, '2019-07-02 16:03:29', 'Wing A', 'Room 5', 10, 17, 1, 6, 3, 'Elizabeth had been a good deal disappointed in not finding a letter from Jane on their first arrival at Lambton; and this disappointment had been renewed on each of the mornings that had now been spent there; but on the third her repining was over, and her sister justified');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (55, 0, '2019-07-14 06:55:04', 'http://dummyimage.com/247x172.jpg/5fa2dd/ffffff', '2019-06-25 15:44:23', 'Wing A', 'Room 2', 11, 3, 1, 4, 1, 'By the receipt of two letters from her at once, on one of which was marked that it had been missent elsewhere. Elizabeth was not surprised at it, as Jane had written the direction remarkably ill.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (56, 0, null, null, '2019-07-16 15:25:37', 'Wing B', 'Room 1', 9, 13, 3, 6, 2, 'They had just been preparing to walk as the letters came in; and her uncle and aunt, leaving her to enjoy them in quiet, set off by themselves. The one missent must first be attended to; it had been written five days ago.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (57, 0, '2019-06-25 15:16:41', null, '2019-07-17 07:38:47', 'Wing C', 'Room 2', 17, 8, 3, 1, 3, 'Mrs. Bennet was in fact too much overpowered to say a great deal while Sir William remained; but no sooner had he left them than her feelings found a rapid vent. In the first place, she persisted in disbelieving the whole of the matter; secondly, she was very sure that Mr. Collins had been taken in; thirdly, she trusted that they would never be happy together; and fourthly, that the match might be broken off.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (58, 0, '2019-07-13 19:21:13', null, '2019-07-07 01:53:21', 'Wing D', 'Room 3', 2, 6, 1, 4, 2, 'The beginning contained an account of all their little parties and engagements, with such news as the country afforded; but the latter half, which was dated a day later, and written in evident agitation, gave more important intelligence. It was to this effect');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (59, 0, '2019-07-22 22:08:38', 'http://dummyimage.com/167x142.jpg/cc0000/ffffff', '2019-07-16 13:49:42', 'Wing D', 'Room 1', 6, 17, 4, 5, 3, 'Since writing the above, dearest Lizzy, something has occurred of a most unexpected and serious nature; but I am afraid of alarming you--be assured that we are all well. What I have to say relates to poor Lydia.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (60, 0, null, 'http://dummyimage.com/158x112.jpg/dddddd/000000', '2019-07-06 20:41:34', 'Wing D', 'Room 2', 19, 11, 3, 3, 1, 'An express came at twelve last night, just as we were all gone to bed, from Colonel Forster, to inform us that she was gone off to Scotland with one of his officers; to own the truth, with Wickham! Imagine our surprise.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (61, 0, null, null, '2019-07-02 22:48:06', 'Wing C', 'Room 1', 5, 16, 2, 5, 1, 'To Kitty, however, it does not seem so wholly unexpected. I am very, very sorry. So imprudent a match on both sides! But I am willing to hope the best, and that his character has been misunderstood. Thoughtless and indiscreet I can easily believe him, but this step (and let us rejoice over it) marks nothing bad at heart.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (62, 0, '2019-06-29 14:53:55', 'http://dummyimage.com/159x173.jpg/ff4444/ffffff', '2019-07-09 20:43:34', 'Wing D', 'Room 2', 7, 12, 4, 1, 3, 'His choice is disinterested at least, for he must know my father can give her nothing. Our poor mother is sadly grieved. My father bears it better. How thankful am I that we never let them know what has been said against him; we must forget it ourselves.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (63, 0, '2019-07-02 03:24:48', 'http://dummyimage.com/237x114.jpg/ff4444/ffffff', '2019-07-21 00:53:41', 'Wing C', 'Room 4', 12, 7, 4, 6, 1, 'They were off Saturday night about twelve, as is conjectured, but were not missed till yesterday morning at eight. The express was sent off directly. My dear Lizzy, they must have passed within ten miles of us.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (64, 0, '2019-07-15 00:59:54', null, '2019-07-15 13:28:49', 'Wing C', 'Room 1', 17, 15, 1, 3, 2, 'Colonel Forster gives us reason to expect him here soon. Lydia left a few lines for his wife, informing her of their intention. I must conclude, for I cannot be long from my poor mother. I am afraid you will not be able to make it out, but I hardly know what I have written.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (65, 0, '2019-06-26 12:10:46', null, '2019-06-28 10:52:01', 'Wing B', 'Room 6', 7, 12, 3, 6, 3, 'Without allowing herself time for consideration, and scarcely knowing what she felt, Elizabeth on finishing this letter instantly seized the other, and opening it with the utmost impatience, read as follows: it had been written a day later than the conclusion of the first');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (66, 0, null, 'http://dummyimage.com/207x109.jpg/ff4444/ffffff', '2019-07-12 15:45:38', 'Wing A', 'Room 3', 17, 4, 1, 5, 2, 'By this time, my dearest sister, you have received my hurried letter; I wish this may be more intelligible, but though not confined for time, my head is so bewildered that I cannot answer for being coherent.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (67, 0, '2019-07-16 18:25:52', null, '2019-07-09 18:30:24', 'Wing A', 'Room 6', 1, 11, 4, 5, 1, 'Elizabeth coloured and laughed as she replied, “Yes, you know enough of my frankness to believe me capable of that. After abusing you so abominably to your face, I could have no scruple in abusing you to all your relations');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (68, 0, '2019-07-21 21:59:15', 'http://dummyimage.com/246x240.jpg/cc0000/ffffff', '2019-07-12 15:27:32', 'Wing C', 'Room 3', 9, 11, 2, 1, 3, 'Dearest Lizzy, I hardly know what I would write, but I have bad news for you, and it cannot be delayed. Imprudent as the marriage between Mr. Wickham and our poor Lydia would be, we are now anxious to be assured it has taken place');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (69, 0, '2019-07-08 10:31:34', null, '2019-06-30 13:28:36', 'Wing B', 'Room 1', 4, 10, 2, 4, 3, 'We will not quarrel for the greater share of blame annexed to that evening,” said Elizabeth. “The conduct of neither, if strictly examined, will be irreproachable; but since then, we have both, I hope, improved in civility');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (70, 0, '2019-07-05 07:00:06', null, '2019-07-03 14:02:33', 'Wing A', 'Room 6', 6, 12, 1, 5, 1, 'I can easily believe it. You thought me then devoid of every proper feeling, I am sure you did. The turn of your countenance I shall never forget, as you said that I could not have addressed you in any possible way that would induce you to accept me.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (71, 0, '2019-07-05 21:07:25', 'http://dummyimage.com/249x179.jpg/dddddd/000000', '2019-07-16 05:40:32', 'Wing C', 'Room 2', 6, 7, 1, 4, 2, 'The letter shall certainly be burnt, if you believe it essential to the preservation of my regard; but, though we have both reason to think my opinions not entirely unalterable, they are not, I hope, quite so easily changed as that implies.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (72, 0, '2019-06-30 22:18:55', null, '2019-07-05 16:59:27', 'Wing C', 'Room 3', 5, 5, 4, 1, 2, 'The letter, perhaps, began in bitterness, but it did not end so. The adieu is charity itself. But think no more of the letter. The feelings of the person who wrote, and the person who received it, are now so widely different from what they were then,');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (73, 0, '2019-07-06 23:38:29', null, '2019-07-07 03:24:29', 'Wing B', 'Room 4', 20, 2, 1, 4, 1, 'I cannot give you credit for any philosophy of the kind. Your retrospections must be so totally void of reproach, that the contentment arising from them is not of philosophy, but, what is much better, of innocence.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (74, 0, '2019-07-14 19:01:54', 'http://dummyimage.com/210x111.jpg/ff4444/ffffff', '2019-07-20 01:32:13', 'Wing A', 'Room 3', 10, 12, 2, 2, 2, 'I was given good principles, but left to follow them in pride and conceit. Unfortunately an only son (for many years an only child), I was spoilt by my parents, who, though good themselves (my father, particularly, all that was benevolent and amiable), allowed, encouraged, almost taught me to be selfish and overbearing; to care for none beyond my own family circle');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (75, 0, null, null, '2019-07-20 11:19:54', 'Wing B', 'Room 1', 7, 15, 3, 6, 3, 'But with me, it is not so. Painful recollections will intrude which cannot, which ought not, to be repelled. I have been a selfish being all my life, in practice, though not in principle. As a child I was taught what was right, but I was not taught to correct my temper. ');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (76, 0, null, null, '2019-07-16 08:40:06', 'Wing D', 'Room 4', 20, 11, 3, 4, 1, 'You taught me a lesson, hard indeed at first, but most advantageous. By you, I was properly humbled. I came to you without a doubt of my reception. You showed me how insufficient were all my pretensions to please a woman worthy of being pleased.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (77, 0, '2019-07-13 16:50:44', null, '2019-06-29 03:40:55', 'Wing C', 'Room 4', 15, 5, 1, 1, 3, 'My manners must have been in fault, but not intentionally, I assure you. I never meant to deceive you, but my spirits might often lead me wrong. How you must have hated me after that evening?');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (78, 0, '2019-06-24 15:27:19', 'http://dummyimage.com/104x170.jpg/5fa2dd/ffffff', '2019-06-28 16:53:49', 'Wing C', 'Room 3', 19, 19, 1, 2, 1, 'Your surprise could not be greater than mine in being noticed by you. My conscience told me that I deserved no extraordinary politeness, and I confess that I did not expect to receive more than my due');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (79, 0, '2019-07-05 06:53:36', 'http://dummyimage.com/174x139.jpg/dddddd/000000', '2019-07-12 11:37:11', 'Wing C', 'Room 3', 9, 5, 2, 1, 1, 'I hoped to obtain your forgiveness, to lessen your ill opinion, by letting you see that your reproofs had been attended to. How soon any other wishes introduced themselves I can hardly tell, but I believe in about half an hour after I had seen you.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (80, 0, '2019-07-04 15:56:43', null, '2019-07-15 08:18:25', 'Wing D', 'Room 4', 12, 7, 2, 1, 3, 'His guilt and his descent appear by your account to be the same,” said Elizabeth angrily; “for I have heard you accuse him of nothing worse than of being the son of Mr. Darcy’s steward, and of that, I can assure you, he informed me himself.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (81, 0, '2019-06-30 23:10:43', null, '2019-07-02 16:38:44', 'Wing C', 'Room 1', 5, 15, 3, 3, 2, 'Leverage agile frameworks to provide a robust synopsis for high level overviews. Iterative approaches to corporate strategy foster collaborative thinking to further the overall value proposition. Organically grow the holistic world view of disruptive innovation via workplace diversity and empowerment.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (82, 0, '2019-07-16 11:15:47', null, '2019-06-29 23:00:48', 'Wing D', 'Room 2', 13, 9, 3, 2, 2, 'Bring to the table win-win survival strategies to ensure proactive domination. At the end of the day, going forward, a new normal that has evolved from generation X is on the runway heading towards a streamlined cloud solution. User generated content in real-time will have multiple touchpoints for offshoring.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (83, 0, '2019-07-04 03:38:30', 'http://dummyimage.com/227x178.jpg/dddddd/000000', '2019-07-02 03:23:32', 'Wing B', 'Room 4', 19, 2, 2, 2, 1, 'Capitalize on low hanging fruit to identify a ballpark value added activity to beta test. Override the digital divide with additional clickthroughs from DevOps. Nanotechnology immersion along the information highway will close the loop on focusing solely on the bottom line.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (84, 0, '2019-07-08 17:18:12', null, '2019-07-15 17:44:17', 'Wing C', 'Room 5', 14, 3, 3, 6, 3, 'Podcasting operational change management inside of workflows to establish a framework. Taking seamless key performance indicators offline to maximise the long tail. Keeping your eye on the ball while performing a deep dive on the start-up mentality to derive convergence on cross-platform integration.');
insert into tickets (id, biohazard, comp_date, img_url, issue_date, location_1, location_2, author_id, owner_id, priority_id, specialization_id, status_id, issue_details) values (85, 0, '2019-07-13 21:01:45', 'http://dummyimage.com/197x114.jpg/ff4444/ffffff', '2019-07-22 07:15:50', 'Wing B', 'Room 5', 6, 14, 1, 1, 1, 'Collaboratively administrate empowered markets via plug-and-play networks. Dynamically procrastinate B2C users after installed base benefits. Dramatically visualize customer directed convergence without revolutionary ROI.');
